  });

  return (
    <div>
      <h2>Let's get started!</h2>
      <p>Sup hoe</p>
      <table className="app-table">
      <thead>
          <tr>
            <td>Temperature</td>
            <td>Humidity</td>
            <td>Water</td>
            <td>Date</td>
          </tr>
        </thead>
      </table>
      {zaznamy.map((zaznam) => {
        return (
          <ExpenseItem
            date={zaznam.date}
            temperature={zaznam.temperature}
            humidity={zaznam.humidity}
            water={zaznam.water}
            id={zaznam.id}
          />
        );
      })}
    </div>
  );
}

